// Complete the substrCount function below.
private fun substrCount(n: Int, s: String): Long {
    var result = 0L

    for (i in 0 until n) {
//        println("")
//        println("i: $i")

        for (j in i..n - 1) {
//            print("$j, ")

            val isPalindrome = isPalindrome(i, j, s)
            if (isPalindrome) {
                result++
            }

//            print(" ")
        }
//        println()
    }

//    println()
    return result
}

private fun isPalindrome(first: Int, last: Int, s: String): Boolean {
    var f = first
    var l = last
    val firstChar = s[first]

    if (f == l) {
//        print("${s[f]}")
        return true
    }

//    for (i in f..l) {
//        print("${s[i]}")
//    }

    while (l > f) {
        if (s[l] != firstChar || s[f] != firstChar) return false
        f++
        l--
    }

    return true
}



